export class Track {
	public id: number = -1;
	public number: number = 0;
	public title: string = "";
	public lyrics: string = "";
	public video: string = "";

	constructor(id: number, number: number, title: string, lyrics: string, video: string) {
		this.id = id;
		this.number = number;
		this.title = title;
		this.lyrics = lyrics;
		this.video = video;
	}
}
